/** Common functions used by Brazos UI Toolki - Coach Views **/

/**Event handling**/
touchClickAttach = function(obje, cont, func)
{
	var recentlyClicked = false;

	var handler = $(obje).on('touchstart click keyup',cont,
	function(e)
	{
		if((e.type == "keyup" && (e.keyCode == 13||e.keyCode == 32)) || e.type != "keyup"){
			if(!recentlyClicked)
			{
			recentlyClicked=true;
			
			if(e.type == 'touchstart')
			{
				var startX = e.originalEvent.changedTouches[0].clientX;
				var startY = e.originalEvent.changedTouches[0].clientY;
				
				$(e.target).on('touchend',cont,
					function(e)
					{
						e.preventDefault();
						e.stopImmediatePropagation();
						if(Math.abs(e.originalEvent.changedTouches[0].clientX-startX)<20&&
							Math.abs(e.originalEvent.changedTouches[0].clientY-startY)<20)
							{
								func(e);
							}
						setTimeout(function(){recentlyClicked=false;},200);
						$(e.target).off('touchend');
					});
			}
			else
			{
				e.preventDefault();
				e.stopImmediatePropagation();
				func(e);
				setTimeout(function(){recentlyClicked=false;},200);
			}
			
			}
		}
	}
	);
	return handler;
}

removeError = function(context) {
	if(context.context && context.context.element)
		context = context.context.element;

	var $controlGroup = $("> .form-group,> .form-group-retro",context);

	$controlGroup.removeClass('has-error clientError');
	$controlGroup.attr('aria-invalid',false);
	$controlGroup.removeAttr('role');
	$controlGroup.removeAttr('aria-label');
	//Fix for DE1879
	$(".popover").remove();
	//Fix for DE1829
    $controlGroup.popover('hide');
    $controlGroup.popover('destroy');
	$controlGroup=null;
	
	$(context).parents(".panel, .modal, .tab-pane").each(function(index, el) {
		if($(this).hasClass("panel")){
			if($(".has-error",this).length == 0){
				$(this).children(".panel-heading").removeClass('panel-heading-error-bp3 panel-heading-error-bp3-border');
				$(this).find(".bp3-general-error:first").hide();
			}
		} else if ($(this).hasClass("modal")) {
			if($(".has-error",$(this).find(".modal-body")).length == 0){
                $(this).prev(".modal-invoke").removeClass('has-error').find('.btn.modal-invoke-element').removeClass("btn-danger");
                //also handle modal case where modal invoke button is inline with other buttons:
                $(this).prev('.btn.modal-invoke-element').removeClass("btn-danger").prev(".modal-invoke").removeClass('has-error');
				$(this).find(".modal-header").removeClass('has-error');
			}
		} else if ($(this).hasClass("tab-pane")) {
			if($(".has-error",this).length == 0){
				$("li a[href='#"+$(el).attr("id")+"']").removeClass("tab-heading-error-bp3").find(".fa-exclamation-triangle").hide();
			}
		} 
	});

	$(context).removeClass('self-error');

	if($(context).parents('.tr').find('.self-error').length == 0)  
		$(context).parents('.tr').find('.td').removeClass('panel-heading-error-bp3-light');
}

addError = function(context, message, skipChildApply,clientSide) {
	if(context.context && context.context.element)
		context = context.context.element;
	
	var existingError = isActiveError(context);
	
	if($(context).css("display") != 'none'){
		var $section = $(context).parents('.panel').children('.panel-heading');
		if(($(context).parents(':hidden').length == 0) || ($section.length > 0)){
			if($section.length > 0){
				//expand if they are not inside a non-active tab
				var $hiddenSections = $(context).parents('.panel').children('.panel-heading.collapsed').children('a');
				var count = 0;
				while($hiddenSections.length > 0 && count < 20){
					//open all closed sections
					for(var i = 0; i < $hiddenSections.length; i++){
							$($hiddenSections[i]).click();
					}
					//update the section list (inner sections)
					$hiddenSections = $(context).parents('.panel').children('.panel-heading.collapsed').children('a');
					count++;
				}
			}
			
			$section.each(function () {
				$(this).addClass('panel-heading-error-bp3 panel-heading-error-bp3-border');
			});
			
			$(context).parents('.tr').find('.td').addClass('panel-heading-error-bp3-light');
			
			if($(context).hasClass('td'))
				  $(context).addClass('self-error');
		}
	}

	if ($(context).css("display") != 'none') {
		$(context).parents(".tab-pane").each(function(index, el) {
			$("li a[href='#"+$(el).attr("id")+"']").addClass("tab-heading-error-bp3").find(".fa-exclamation-triangle").show();
		});
	}
    $(".modal-invoke",$(context).parents(".Modal")).addClass('has-error');
    $(".btn.modal-invoke-element",$(context).parents(".Modal")).addClass("btn-danger");
	$(context).parents(".brazos-modal").find(">*>*>.modal-header").addClass('has-error');

	if(!skipChildApply) {
		$(" > .form-group, > .form-group-retro",context).addClass('has-error');
		if(clientSide == true){
			$("> .form-group,> .form-group-retro",context).addClass('clientError');
		}
		$("> .form-group,> .form-group-retro",context).attr('aria-invalid',true);
		$("> .form-group,> .form-group-retro",context).attr('role','alert');
		$("> .form-group,> .form-group-retro",context).attr('aria-label',message);
		try{
			var validationErrorLabel = VALIDATION_ERROR_LABEL ? VALIDATION_ERROR_LABEL : "Validation Error";
		} catch (e) {
			//IE8 Fix
			var validationErrorLabel = "Validation Error";
		}
		if(existingError){
			$("> .form-group,> .form-group-retro",context).data('bs.popover').options.content = message;
		} else {
			$("> .form-group,> .form-group-retro",context).popover({
				title: '<font color=#B94A48>' + validationErrorLabel + '</font>',
				content: message,
				trigger: 'hover focus',
				placement: 'auto top',
				container: 'body',
				html:'true'
			});
		}
	}
}

isActiveError = function(context){
	var result = false;
	
	if(context.context && context.context.element)
		context = context.context.element;
	
	result = $("> .form-group,> .form-group-retro",context).hasClass('has-error');
	return result;
}

isActiveClientSideError = function(context){
	var result = false;
	
	if(context.context && context.context.element)
		context = context.context.element;
	
	result = $(".form-group,.form-group-retro",context).hasClass('clientError');
	
	return result;
}

handleValidationEventForInput = function(event,_this){
	if(isActiveError(_this) && event.type == "error"){
		_this.errorTimeout = false;
		if (event.errors!=null && event.errors.length > 0) {
			$("> .form-group,> .form-group-retro",_this.context.element).data('bs.popover').options.content = event.errors[0].message;
		}
	} else if (event.type == "error"){
		if (event.errors!=null && event.errors.length > 0) {
			addError(_this, event.errors[0].message);
		}
	} else if(isActiveError(_this)){
		_this.errorTimeout = true;
		setTimeout(function(){
			if(_this.errorTimeout){
				removeError(_this);
			}
		},200);
	}
}

