//returns the parent, index of parent and parentType of the first hit on the Parent Type
function indexOfParent(currentView,parentTypeList){
	var parents = $(currentView.context.element).parents();
	var countParents=0,tdCount, call,childView,parent;
	
	var result = {parent:null,index:-1,parentType:null,rowHtml:null,objectData:null};
	//update parentTypeList if none is provided
	if(parentTypeList == null || parentTypeList == undefined || parentTypeList == ""){
		parentTypeList = ['Table_Deprecated', 'Cards','Data_Table'];
	}
	//Check where is the table on the parents hierarchy of the element
	checkClass:
	for(var i = 0; i < parents.length; i++){
		if(parents[i].getAttribute('data-viewid')!=null){
			countParents++;
		}
		//stop when the table that bounds the button is reached
		for(var j = 0; j < parentTypeList.length; j++){
			if($(parents[i]).hasClass(parentTypeList[j])){
				result.parentType=parentTypeList[j];
				break checkClass;
			}
		}
	}
	
	//If a parent was found
	if(result.parentType != null){
		//get the Table View and the first view inside the table
		call = "currentView";
		for(var i =0; i < countParents-1;i++){
			call += ".context.parentView()";
		}
		childView = eval(call);
		parent = eval(call+".context.parentView()");
		
		//Determine the index of the row on the table
		if(result.parentType == 'Table_Deprecated'){
			tdCount = $(".tbody:first > .tr",parent.context.element).index(childView.context.element.parentElement);
		}else if(result.parentType == 'Cards'){
			tdCount = $(".carousel-inner:first > .ContentBox",parent.context.element).index(childView.context.element.parentElement);
		}else if(result.parentType == 'Data_Table'){
			var table = $('#'+parent.tableId).dataTable(); //Get the table object
			try{
				tdCount = table.fnGetPosition(childView.context.element.parentElement)[0]; //get the index
				result.rowHtml = childView.context.element.parentElement.parentElement;
				result.objectData = table.fnGetData(tdCount);
			}catch(e){
				tdCount = -1;
			}
		}
		//Update result
		result.index = tdCount;
		result.parent = parent;
	}
	return result;
}

//update the .listSelection of a the list that wraps the element
function updateSelectionList(firstParent){
	if(firstParent.parentType != null && (firstParent.parentType != "Data_Table" || (firstParent.parentType == "Data_Table" && firstParent.parent.isBindingList))){
		// the button is inside a repeating element and it will select the index of it
		// If the binding is set on the table correctly, update the list selected index
		if(firstParent.parentType != "Data_Table"){
			if (firstParent.parent.context.binding) {
				firstParent.parent.context.binding.get("value").set("listAllSelectedIndices", []);
				firstParent.parent.context.binding.get("value").set("listAllSelectedIndices", [firstParent.index]);
			}
		}else{
			if (firstParent.parent.context.binding) {
				var listOfSelectedValues = firstParent.parent.context.binding.get("value").get("listAllSelectedIndices");
				//If it's already there, remove it to have on the last selected
				var indexOnArray = $.inArray( firstParent.index, listOfSelectedValues);
				if(indexOnArray > -1){
					listOfSelectedValues.splice(indexOnArray, 1);
				}
				//update the selection list
                if(firstParent.parent.context && firstParent.parent.context.options.selectionType && firstParent.parent.context.options.selectionType.get("value") === "single"){
                    //if the table is single select the other selected indexs are deleted
                    listOfSelectedValues = [];
                }
				listOfSelectedValues.unshift(firstParent.index);
				firstParent.parent.context.binding.get("value").set("listAllSelectedIndices", listOfSelectedValues);
			}
		}
	} else if(firstParent && firstParent.parent && firstParent.parent.context.options.selectedRows){
		if(firstParent.parent.context.options.selectionType.get("value") == "multiple"){
			var newSelectionList = firstParent.parent.context.options.selectedRows.get("value").items;
			newSelectionList[newSelectionList.length] = firstParent.objectData;
			firstParent.parent.context.options.selectedRows.set("value",newSelectionList);
		} else {
			firstParent.parent.context.options.selectedRows.set("value",[firstParent.objectData]);
		}
	}
}

/*Trim function when browser doesn't support it*/
if(!String.prototype.trim) {
  String.prototype.trim = function () {
    return this.replace(/^\s+|\s+$/g, '');
  };
}

/*Includes function -- originally added this as an extension of array.includes for IE, but it caused an error with the IBM coach framework code*/
arrayIncludes = function(array,searchElement) {
    var O = Object(array);
    var len = parseInt(O.length) || 0;
    if (len === 0) {
        return false;
    }
    var n = parseInt(arguments[1]) || 0;
    var k;
    if (n >= 0) {
        k = n;
    } else {
        k = len + n;
        if (k < 0) {k = 0;}
    }
    var currentElement;
    while (k < len) {
        currentElement = O[k];
        if (searchElement === currentElement ||
         (searchElement !== searchElement && currentElement !== currentElement)) {
            return true;
        }
        k++;
    }
    return false;
};

/*Transform visibility string*/
transformVisibilityString = function(visibilityString){
	if(visibilityString != null){
		visibilityString = visibilityString.replace(/\s/g, "");
		visibilityString = visibilityString.toUpperCase();
	}
	if(visibilityString == "HIDDEN")
		visibilityString = "NONE";
	return visibilityString;
}

/* Charts Functions*/
applyChartDimensions = function(view,height,width){
  if(height == 0){ height = 300;}
  if(width == 0){ width = null;}
  
  view.context.element.getElementsByTagName("svg")[0].style.height = "" + height + 'px';
  if (width != null) {
    view.context.element.getElementsByTagName("svg")[0].style.width = "" + width + 'px';
  }
}

/* Resize Complex Controls When Shown from inside modals, tabs, and collapsed sections */
addResizeEvents = function(_this,resizeFunction){
	var $parents = $(_this.context.element).parents();

	//Force resize when chart is inside a modal or a Tab (initally hidden)
	if ($parents.hasClass("Modal")) {
		var $modal = $('> .modal ', $parents.filter(".Modal:first"));
		$modal.on("shown.bs.modal",function(){
		    resizeFunction();
		});
	}
	if($parents.hasClass("Tabs")){
		var $tab = $('ul > li', $parents.filter(".Tabs:first"));
		$tab.on("shown.bs.tab",function(){
		    resizeFunction();
		});
	}
	if($parents.hasClass("Section")){
	    var $collapsiblePanel = $(".panel-collapse",$parents.filter(".Section"));
        $collapsiblePanel.on("shown.bs.collapse", function(){
            resizeFunction();
        });
	}
}

/* Responsive settings */
addResponsiveSettings = function (view,controlElement){
  if (view.context.options.phone != undefined && view.context.options.phone != null && view.context.options.phone.get("value") == true) {
    $(controlElement).addClass("hidden-xs");
  }

  if (view.context.options.tablet != undefined && view.context.options.tablet != null && view.context.options.tablet.get("value") == true) {
    $(controlElement).addClass("hidden-sm");
  }

  if (view.context.options.desktop != undefined && view.context.options.desktop != null && view.context.options.desktop.get("value") == true) {
    $(controlElement).addClass("hidden-md hidden-lg");
  }
}

