//Format functions
var displayNumberWithCommas = function (number,decimalPlaces) {

    if(number != null && !isNaN(number) && typeof number != "object"){
        var thousandSeparator = ",";
        var decimalSeparator = ".";
        try{
            thousandSeparator = NUMBER_THOUSANDS_SEPARATOR;
            decimalSeparator = NUMBER_DECIMAL_SEPARATOR;
        } catch(e){}

        if(decimalPlaces != null && !isNaN(decimalPlaces)){
			number = Number(number).toFixed(decimalPlaces);
		}
		var pieces = String(number).split(".");
		pieces[0] = pieces[0].toString().replace(/\B(?=(\d{3})+(?!\d))/g, thousandSeparator);
		return pieces.join(decimalSeparator);
	} else {
		return '-';
	}
}
var displayFormattedUSPhoneNumber = function (phoneNum) {
	if(!isNaN(phoneNum) && typeof phoneNum != "object"){
        phoneNum = (""+phoneNum).split(" ").join("");
        phoneNum = phoneNum.split("-").join("");
        phoneNum = phoneNum.split(".").join("");

        if(phoneNum.length == 10){
            phoneNum = phoneNum.substr(phoneNum.length-10, phoneNum.length);
            phoneNum = phoneNum.replace(/(\d{3})(\d{3})(\d{4})/, "($1) $2-$3");
        } else if(phoneNum.length == 7) {
        	phoneNum = phoneNum.replace(/(\d{3})(\d{4})/, "$1-$2");
        } else {
        	console.warn("Phone number must be 10 or 7 digits.",phoneNum);
        	phoneNum = "-";
        }
        
        return phoneNum;
	} else {
		return "-";
	}
}
