//Handle Control Visibility
var updateControlVisibility = function(_this,$input,isButton, tooltipIcon){
    if(!isButton){
		var controlVis = _this.context.options._metadata.visibility ? _this.context.options._metadata.visibility.get("value") : "DEFAULT";
	} else {
		//Handle IBM BPM 8.0.1 Bug with Buttons Tables
		var controlVis = (_this.context.options._metadata.visibility && (!_this.context.options._metadata.visibility.bindingStr || _this.context.options._metadata.visibility.boundObject)) ? _this.context.options._metadata.visibility.get("value") : "DEFAULT";
	}
	
    // Inherit parent's visibility
	var parentVis = _this.context.getInheritedVisibility();
    controlVis = (controlVis == "DEFAULT") ? parentVis : controlVis;
    controlVis = transformVisibilityString(controlVis);

    // handle control visibility
    _this.context.setDisplay(controlVis != "NONE");
	
	if($input){
		//Handle control-specific visibility
		$input.removeAttr("disabled");
		$input.removeAttr("aria-required");
		var $tooltipTarget = $input;
		if(controlVis == "READONLY"){
			$input.attr("disabled","disabled");
			$tooltipTarget = $input.parent();
		} else if(controlVis == "REQUIRED"){
			$input.attr("aria-required","true");
		}
		// add help text
		$input.tooltip('destroy');
		$input.parent().tooltip('destroy');
		addTooltip(_this, $tooltipTarget, 'hover focus', 'bottom', tooltipIcon);
	}
    return controlVis;
};

//Handle Label Visibility
var updateLabelVisibility = function(_this,$label,controlVis,ignoreRequired){
	var labelVis = _this.context.options._metadata.labelVisibility ? _this.context.options._metadata.labelVisibility.get("value") : "";
	
	// Set the content and visibility of the label
	var labelText = _this.context.options._metadata.label ? _this.context.htmlEscape(_this.context.options._metadata.label.get("value")) : "";
	var $labelText = $("span:first", $label);
	$labelText.html(labelText);
	$label.toggle(labelVis != "HIDE");
	
	if(!ignoreRequired){
		// Add (*) if control is required
		$(".bp3ControlRequired",_this.context.element).remove();
		if(controlVis == "REQUIRED" && labelVis != "HIDE"){
			var alignment = getInheritedProperty(_this,"formAlignment") ? getInheritedProperty(_this,"formAlignment") : "above";
			if(alignment == "left")
				$("<i class='fa fa-asterisk bp3ControlRequired'></i>").insertAfter($label);
			else
				$label.append("<i class='fa fa-asterisk bp3ControlRequired'></i>");
		}
	}
	return labelVis;
}

//Check if the parent view is a Tabs and if it is update the proper tab label
var checkAndUpdateTabLabel = function(parentView, viewId, value){
    if(parentView && parentView.context){
        var parentElement = parentView.context.element;
        var isTabs = ($("div.Tabs", parentElement.parent).length > 0);
        if(isTabs && typeof parentView.labelTabUpdate == "function"){
            parentView.labelTabUpdate(viewId, value);
        }
    }
}

